System.register("chunks:///_virtual/CfgTextLoading.ts",["cc"],(function(t){var e;return{setters:[function(t){e=t.cclegacy}],execute:function(){e._RF.push({},"9f68fojWpFJ8oF+QYOIIUj4","CfgTextLoading",void 0);t("default",{1:{id:1,text:"据说好玩的游戏一般体积大，所以加载慢"},2:{id:2,text:"通过观察小地图，可以查看队友的位置"},3:{id:3,text:"挂机会扣除信誉分的哦~"},4:{id:4,text:"不知道怎么玩？看看教程学习一下吧！"},5:{id:5,text:"遇到不文明行为？点击头像可以进行举报"},6:{id:6,text:"打开系统声音后体验更佳哦~"},7:{id:7,text:"喜欢TA记得加好友哦"},8:{id:8,text:"想要时装？商城内的免费宝箱可以满足你~"},9:{id:9,text:"可以在设置中调节方向滑动灵敏度"},10:{id:10,text:"打开语音和队友实时沟通战术，会让你的胜率增加"},11:{id:11,text:"射击时尽量靠近建筑物，血量不足时躲进掩体"},12:{id:12,text:"场景中降落的空投箱中可以拾取高阶武器，注意争抢"},13:{id:13,text:"开枪时向下滑动右侧屏幕压枪，可以抵消枪械的后坐力"},14:{id:14,text:"当觉得游戏不流畅时，可以在设置中改为低画质试试"},15:{id:15,text:"持有狙击枪时，找一个房顶居高临下进行射击是个不错的战术"},16:{id:16,text:"瞄准时，尽量射击头部会产生爆头效果，伤害较高"},17:{id:17,text:"游戏开始前可打开背包切换武器"},18:{id:18,text:"敌方投掷过来的手雷，要再爆炸前远离"},19:{id:19,text:"敌方投掷过来的闪光弹，在闪光之前转向背身可减少白屏时间"},20:{id:20,text:"记得每天上线领取合成收益哦"},21:{id:21,text:"强化一把你喜欢的武器，成为你的主战武器"},22:{id:22,text:"重量越重的武器，会导致你的移动速度变慢"},23:{id:23,text:"从越高的高处跌落，掉血越多"},24:{id:24,text:"烟雾弹会喷出烟雾阻挡所有玩家视野，请注意善加利用"},25:{id:25,text:"优先躲避落到身旁的手雷，距离手雷越近伤害越高"},26:{id:26,text:"游戏中的载具需要钥匙才能启动使用，或者乘坐其他玩家已经启动的载具"},27:{id:27,text:"强化过的武器战斗力将大幅提升"},28:{id:28,text:"穿戴头盔和防弹衣可以大幅减少敌人对你造成的伤害"},29:{id:29,text:"注意抢夺空投中强大的专属武器"},30:{id:30,text:"合理利用投掷物如手雷，闪光弹对敌人造成伤害"},31:{id:31,text:"可以在设置中设置你习惯的摇杆和按键位置哦"},32:{id:32,text:"蹲下射击后坐力降低30%，趴下射击降低50%"},33:{id:33,text:"背对闪光弹可以将闪光弹效果降到最低"},34:{id:34,text:"三排不勾选自动补人的话，你会一个人一个队伍对战其他满编队伍"},35:{id:35,text:"攻击头部产生暴击的伤害是攻击躯干伤害的2倍"},36:{id:36,text:"攻击四肢的伤害只有躯干的一半伤害"},37:{id:37,text:"霰弹枪在近战中伤害高，射击面广，但是射程太近"},38:{id:38,text:"一把步枪+一把狙击枪是最佳主武器组合"},39:{id:39,text:"开镜射击可以让射击精度提高很多"},40:{id:40,text:"被攻击后，第一时间寻找掩体或者进行蛇形走位躲避攻击"},41:{id:41,text:"注意屏幕中央子弹弧形圈，表示攻击你的敌人射击方位"},42:{id:42,text:"拾取空投和救援队友时可以先打一个烟雾弹"}});e._RF.pop()}}}));

